 ('1', '1', 'en', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-02-27 15:05:18', '2017-02-27 15:05:18', 'd48ca024-d652-4438-a3dc-962962d1f6c3'),
 ('2', '2', 'en', 'Welcome to Victoriafans!', '<p>It’s true, this site doesn’t have a whole lot of content yet, but don’t worry. Our web developers have just installed the CMS, and they’re setting things up for the content editors this very moment. Soon Victoriafans will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.</p>', NULL, NULL, NULL, NULL, NULL, '2017-02-27 15:05:21', '2017-02-27 15:05:21', 'dad32780-537e-4516-b84f-11244b4888f3'),
 ('3', '3', 'en', 'We just installed Craft!', '<p>Craft is the CMS that’s powering Victoriafans. It’s beautiful, powerful, flexible, and easy-to-use, and it’s made by Pixel &amp; Tonic. We can’t wait to dive in and see what it’s capable of!</p><!--pagebreak--><p>This is even more captivating content, which you couldn’t see on the News index page because it was entered after a Page Break, and the News index template only likes to show the content on the first page.</p><p>Craft: a nice alternative to Word, if you’re making a website.</p>', NULL, NULL, NULL, NULL, NULL, '2017-02-27 15:05:21', '2017-02-27 15:05:21', 'ea7264c8-aa7b-4154-9d9e-6c93364c98f9'),
 ('4', '4', 'en', 'Warm Air Extraction', NULL, NULL, NULL, NULL, NULL, '<p>This is Warm Air Extraction, Lorem ipsum dolor sit amet, consectetur adipisicing elit. Ipsam minus totam in explicabo voluptate quas consequatur mollitia, ducimus adipisci aliquid animi vero veritatis fugit! Enim commodi optio, itaque nisi fugit!</p>', '2017-02-27 15:10:36', '2017-03-01 10:32:09', 'bc052df8-01ea-4e6a-abd0-020f9b1eabc9'),
 ('5', '5', 'en', 'Fume Control', NULL, NULL, NULL, NULL, NULL, NULL, '2017-02-27 15:10:49', '2017-02-27 15:10:49', '230df4f4-69d8-4aa4-9295-4d030d7a75e9'),
 ('6', '6', 'en', 'Emergency Smoke Extraction', NULL, NULL, NULL, NULL, NULL, NULL, '2017-02-27 15:11:01', '2017-02-27 15:11:01', '9448227d-ccd3-444f-95fe-b694d9c55e45'),
